import React, { useState, useEffect } from 'react';
import { SupabaseService, Listing } from '../lib/supabaseService';

const DatabaseExplorer: React.FC = () => {
  const [listings, setListings] = useState<Listing[]>([]);
  const [soldListings, setSoldListings] = useState<Listing[]>([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const exploreDatabase = async () => {
    setLoading(true);
    setError(null);

    try {
      // Test both tables
      const [listingsData, soldData] = await Promise.all([
        SupabaseService.searchListings('', 5), // Get first 5 listings
        SupabaseService.getSoldListings('', 5) // Get first 5 sold listings
      ]);

      setListings(listingsData);
      setSoldListings(soldData);

      console.log('Listings:', listingsData);
      console.log('Sold Listings:', soldData);

    } catch (err) {
      setError(err instanceof Error ? err.message : 'Unknown error');
      console.error('Database exploration error:', err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    exploreDatabase();
  }, []);

  return (
    <div className="p-6 bg-white rounded-lg shadow-sm border border-gray-200">
      <h2 className="text-lg font-semibold text-gray-900 mb-4">Database Explorer</h2>

      <button
        onClick={exploreDatabase}
        disabled={loading}
        className="mb-4 bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700 disabled:bg-gray-400"
      >
        {loading ? 'Exploring...' : 'Explore Database'}
      </button>

      {error && (
        <div className="mb-4 p-3 bg-red-100 border border-red-400 text-red-700 rounded">
          Error: {error}
        </div>
      )}

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Current Listings */}
        <div>
          <h3 className="text-md font-medium text-gray-900 mb-2">Current Listings ({listings.length})</h3>
          <div className="space-y-2 max-h-64 overflow-y-auto">
            {listings.map((listing) => (
              <div key={listing.id} className="p-2 bg-gray-50 rounded text-sm">
                <div className="font-medium">{listing.address || 'No address'}</div>
                <div className="text-gray-600">
                  {listing.city && listing.state ? `${listing.city}, ${listing.state}` : 'No location'}
                </div>
                <div className="text-xs text-gray-500">
                  ID: {listing.id} | Price: ${listing.price || 'N/A'}
                </div>
                <pre className="text-xs mt-1 text-gray-400 overflow-hidden">
                  {JSON.stringify(listing, null, 2).substring(0, 200)}...
                </pre>
              </div>
            ))}
          </div>
        </div>

        {/* Sold Listings */}
        <div>
          <h3 className="text-md font-medium text-gray-900 mb-2">Sold Listings ({soldListings.length})</h3>
          <div className="space-y-2 max-h-64 overflow-y-auto">
            {soldListings.map((listing) => (
              <div key={listing.id} className="p-2 bg-gray-50 rounded text-sm">
                <div className="font-medium">{listing.address || 'No address'}</div>
                <div className="text-gray-600">
                  {listing.city && listing.state ? `${listing.city}, ${listing.state}` : 'No location'}
                </div>
                <div className="text-xs text-gray-500">
                  ID: {listing.id} | Price: ${listing.price || 'N/A'}
                </div>
                <pre className="text-xs mt-1 text-gray-400 overflow-hidden">
                  {JSON.stringify(listing, null, 2).substring(0, 200)}...
                </pre>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default DatabaseExplorer;
